// Nav.js
function Nav() {
    return (
      <nav>
        <ul>
          <li><a href="/">Home</a></li>
          <li><a href="/menu">Menu</a></li>
          <li><a href="/reservations">Reservations</a></li>
          <li><a href="/about">About Us</a></li>
        </ul>
      </nav>
    );
  }
  export default Nav;
